const Item = ({item}) => {

  return (
      <div className="order-item">
          {item.map(el =>
              <div key={el.id}>ID: {el.id}<br /> Name: {el.name}<br /> Price: {el.price} <br /> Qty: {el.qty}<br /></div>
          )}

      </div>
  );
}

export default Item;
